import React from 'react';
import {
    Navbar,
    Container
 } from 'react-bootstrap';

class NavBar extends React.Component {
    render() {
        const NavStyle = {
            background: '#D6B064',
            height: '85px',
        }
        return (
            <Navbar style={NavStyle} >
                <Container></Container>
                    <Navbar.Brand>
                        <img
                            alt="DialexaBVG"
                            src="/assets/dialexarobot.png"
                            className="d-inline-block align-top"
                        />
                    </Navbar.Brand>

            </Navbar>
        );
    }
}

export default NavBar;
